import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './TutorDashboard.css';

function TutorDashboard() {
    const location = useLocation();
    const navigate = useNavigate();
    const { floorData } = location.state || { floorData: [] };
    const [roomsInfo, setRoomsInfo] = useState({});

    useEffect(() => {
        const rooms = {};
        floorData.forEach(student => {
            const roomNumber = student[5];
            if (!rooms[roomNumber]) {
                rooms[roomNumber] = [];
            }
            rooms[roomNumber].push(student);
        });
        setRoomsInfo(rooms);
    }, [floorData]);

    return (
        <div className="container">
            <h1>Welcome to the Tutor Dashboard</h1>
            <div className="room-info">
                <h2>Room Information</h2>
                {Object.keys(roomsInfo).map(roomNumber => (
                    <button key={roomNumber} onClick={() => navigate(`/room/${roomNumber}`, { state: { students: roomsInfo[roomNumber] } })}>
                        Room {roomNumber}
                    </button>
                ))}
            </div>
        </div>
    );
}

export default TutorDashboard;
